import React from "react";

export default function KeyBoard(){
    return (
        <div className="key-grid">
            {Array.from({length : 26},(_,i)=>i+1).map((i)=>{
                return <Key code={i} key={i} />
            })}
        </div>
    )
}

function Key({code}){
    return(
        <p className="item">{code}</p>
    )
}
